import React from "react";
import Logo from "../Logo";
import css from "./style.module.css";
import Menu from "..Menu";

const Toolbar = () => (
  <header className={css.Toolbar}>
    <div>...</div>
    <Logo />
    <Menu />
    <nav>Цэс</nav>
  </header>
);

export default Toolbar;
